// Helper functions
export const getTotal = () => dataset.length;

export const getRiskCounts = () => {
  const counts = { Low: 0, Medium: 0, High: 0 };
  dataset.forEach((r) => counts[r.riskLevel]++);
  return counts;
};

export const getGenderCounts = () => {
  const result: { gender: string; Low: number; Medium: number; High: number }[] = [
    { gender: "Male", Low: 0, Medium: 0, High: 0 },
    { gender: "Female", Low: 0, Medium: 0, High: 0 },
  ];
  dataset.forEach((r) => {
    const g = r.gender === "Male" ? 0 : 1;
    result[g][r.riskLevel]++;
  });
  return result;
};

export const getAgeGroupData = () => {
  const groups = [
    { age: "18-25", Low: 0, Medium: 0, High: 0 },
    { age: "26-35", Low: 0, Medium: 0, High: 0 },
    { age: "36-45", Low: 0, Medium: 0, High: 0 },
    { age: "46-55", Low: 0, Medium: 0, High: 0 },
    { age: "56-65", Low: 0, Medium: 0, High: 0 },
    { age: "66-79", Low: 0, Medium: 0, High: 0 },
  ];
  dataset.forEach((r) => {
    let idx = 0;
    if (r.age <= 25) idx = 0;
    else if (r.age <= 35) idx = 1;
    else if (r.age <= 45) idx = 2;
    else if (r.age <= 55) idx = 3;
    else if (r.age <= 65) idx = 4;
    else idx = 5;
    groups[idx][r.riskLevel]++;
  });
  return groups;
};

export const getRegionData = () => {
  const regions: { [key: string]: { total: number; Low: number; Medium: number; High: number; avgBmi: number; avgHb: number; avgIncome: number; healthHistoryYes: number } } = {};
  dataset.forEach((r) => {
    if (!regions[r.region]) {
      regions[r.region] = { total: 0, Low: 0, Medium: 0, High: 0, avgBmi: 0, avgHb: 0, avgIncome: 0, healthHistoryYes: 0 };
    }
    const reg = regions[r.region];
    reg.total++;
    reg[r.riskLevel]++;
    reg.avgBmi += r.bmi;
    reg.avgHb += r.hemoglobin;
    reg.avgIncome += r.incomeLevel;
    if (r.healthHistory) reg.healthHistoryYes++;
  });
  return Object.entries(regions).map(([name, d]) => ({
    name,
    total: d.total,
    low: d.Low,
    medium: d.Medium,
    high: d.High,
    highRiskPct: ((d.High / d.total) * 100).toFixed(1),
    mediumRiskPct: ((d.Medium / d.total) * 100).toFixed(1),
    lowRiskPct: ((d.Low / d.total) * 100).toFixed(1),
    avgBmi: (d.avgBmi / d.total).toFixed(1),
    avgHb: (d.avgHb / d.total).toFixed(1),
    avgIncome: Math.round(d.avgIncome / d.total),
    healthHistoryPct: ((d.healthHistoryYes / d.total) * 100).toFixed(1),
  }));
};

export const getAnemiaCount = () =>
  dataset.filter((r) => r.hemoglobin < 12).length;

export const getHealthHistoryCount = () =>
  dataset.filter((r) => r.healthHistory).length;

export const getAvgBmi = () =>
  (dataset.reduce((s, r) => s + r.bmi, 0) / dataset.length).toFixed(1);

export const getAvgHemoglobin = () =>
  (dataset.reduce((s, r) => s + r.hemoglobin, 0) / dataset.length).toFixed(1);
